
import random

cons_groupes = ["bdg", "ptk", "mn", "fs", "vzj", "lr"]
voy_groupes = ["aeiou", "a", "e", "i", "o", "u"]
group_codes = "abcdef012345"


def gen_letter(group):
    index = random.randint(0, len(group) - 1)
    return group[index]


def gen_pseudo(pattern):
    result = ""
    for group_code in pattern:
        if group_code.isalpha():
            index = ord(group_code) - ord('a')
            result += gen_letter(cons_groupes[index])
        else:
            index = ord(group_code) - ord('0')
            result += gen_letter(voy_groupes[index])
    return result


def gen_random_pattern(min_len, max_len):
    result = ""
    for i in range(0, random.randint(min_len, max_len)):
        result += gen_letter(group_codes)
    return result


def gen_sub_patterns(pattern):
    result = []
    for i in range(len(pattern)):
        for j in range(i + 2, len(pattern)+1):
            if j - i <= 4:
                result += [pattern[i:j]]
    return result


